ним элементом, то при редактировании дочернего элементы вы увидите что выбран родительский элемент.','Supports'=>'Поддерживающие','Title'=>'Заголовок','Author'=>'Автор','Trackbacks'=>'Обратные ссылки','Page Attributes'=>'Атрибуты страницы','Hierarchical Permalinks'=>'Иерархические ссылки','Default'=>'По умолчанию','Cleanup'=>'Очистка','Current Color'=>'Текущий цвет','Templates'=>'Шаблоны','Due to a number of optimizations in Pods 2.x, we need to run a few updates to your database. This should not remove or change your existing Pod data from 1.x, so if you wish to rollback to Pods 1.x - you can easily do that.'=>'В связи с количеством оптимизаций в Pods 2.x, необходимо запустить несколько обновлений вашей базы данных. Это не удалит и не изменит ваши существующие данные из Pods 1.x, так что если вы захотите вернуться к Pods 1.x -  вы легко сможете это сделать.','https://pods.io/'=>'https://pods.io/','https://pods.io/about/'=>'https://pods.io/about/','One option per line, use <em>value|Label</em> for separate values and labels'=>'Один вариант на строку, используйте <em>подпись|значение</em> для разделения подписей и значений.','Before Content'=>'Перед содержимым','After Content'=>'После содержимого','Menu Label'=>'Ярлык меню','-- Select Table --'=>'-- Выбор таблицы --','Genesis: SEO'=>'Genesis: SEO','Genesis: Layouts'=>'Genesis: макет','Genesis: Simple Sidebars'=>'Genesis: Простые сайдбары','YARPP Support'=>'Поддержка YARPP','Display a field from this item'=>'Отображение поля из этого элемента','Pods Page'=>'Страница Pods','Upgrade Complete!'=>'Обновление завершено!','Migration Complete!'=>'Миграция завершена!','Start using Pods'=>'Начать использовать Pods','Relationships'=>'Отношения','1 free month'=>'1 бесплатный месяц','Receive 25% off'=>'Получите скидку 25%','No Hierarchical Fields found'=>'Иерархические поля не найдены','Advanced Supports'=>'Расширенная поддержка','Jetpack Markdown Support'=>'Поддержка Jetpack Markdown','Jetpack Publicize Support'=>'Поддержка Jetp