удут удалены и будет произведена свежая установка.','<strong>Please Note:</strong> This does not remove any items from any Post Types, Taxonomies, Media, Users, or Comments data you have added/modified.'=>'<strong>Обратите внимание:</strong> Это не удалит никаких элементов из Типов Постов, Таксономии, Медиа, Пользователей или Комментариев, которые были вами добавлены или отредактированы.','Are you sure you want to do this?

This is a good time to make sure you have a backup. We are deleting all of the data that surrounds 2.x, resetting it to a clean first install.'=>'Вы уверены что хотите это сделать?

